import React from "react";
import "./Authentication.css";
import Form from "../Form/Form";
import validations from "../../Validations/Validations";
export default function Authentication(props) {
  return (
    <div className="auth_container">
      <Form
        fields={{ Email: "", Message: "" }}
        elements={[
          {
            id: 1,
            type: "input",
            title: "First Name",
            placeholder: "first name",
            customClass: "first_name",
            validate: (v) => {
              return validations && validations.first_name
                ? validations.first_name.test(v.toString().toLowerCase())
                : false;
            },
          },

          {
            id: 2,
            type: "input",
            title: "Last Name",
            placeholder: "last name",
            customClass: "last_name",
            validate: (v) => {
              return validations && validations.last_name
                ? validations.last_name.test(v.toString().toLowerCase())
                : false;
            },
          },
          {
            id: 3,
            type: "input",
            title: "Email",
            placeholder: "Email",
            customClass: "email",
            validate: (v) => {
              return validations && validations.email
                ? validations.email.test(v.toString().toLowerCase())
                : false;
            },
          },
        ]}
      />
    </div>
  );
}
